import { React } from "react";
import { NavLink } from "react-router-dom";
const NavBar = () => {
  return (
    <>
      <button component={NavLink} to="/">
        home
      </button>
      <button component={NavLink} to="/about">
        about
      </button>
    </>
  );
};
export default NavBar;
